import React from 'react';
import './AddUser.css';
import Card from './UI/Card';

const AddUser = () => {
  const addUserHandler = () => {};

  return (
    <Card className='input'>
      <form onSubmit={addUserHandler}>
        <label>이름</label>
        <input type='text' />
        <label>나이</label>
        <input type='number' />
      </form>
    </Card>
  );
};

export default AddUser;
